import "./App.css";
import TraversNavbar from "./Components/TraversNavbar";
function App() {
  return (
    <>
      <h1>Hello from App.js</h1>
      <TraversNavbar />
      <button
        type="button"
        className="navbar-toggler"
        data-bs-toggle="collapse"
        data-bs-target="#menu"
      ></button>
    </>
  );
}

export default App;
